import React from "react"

class Hamburger extends React.Component {
	constructor(props) {
		super(props)
		this.state = {
			isOpen: false
		}
		this.HamburgerToggle = this.HamburgerToggle.bing(this)
	}

	HamburgerToggle() {
		console.log('Working!')
	}

    render() {
        return (
            <div>
            	<i className="fa fa-bars fa-2x hamburger" onClick={this.HamburgerToggle}></i>
            </div>
        )
    }
}

export default Hamburger
